class Solution {
    public int makeTheIntegerZero(int num1, int num2) {
        int operations = 0;
        while (num1 > 0) {
            if (num2 == 0) return -1; // If num2 is 0, it's impossible to continue.
            int i = 60;
            // Try to find the maximum i where 2^i + num2 <= num1
            while (i >= 0 && (1L << i) + num2 > num1) {
                i--;
            }
            if (i < 0) return -1; // If no such i is found, return -1.
            num1 -= (1 << i) + num2; // Perform the operation
            operations++;
        }
        return operations;
    }
}
